import React from "react";
import "./SideBar.css";
import HouseIcon from '@mui/icons-material/House';
import SearchIcon from '@mui/icons-material/Search';
import StarOutlineIcon from '@mui/icons-material/StarOutline';
import QueueMusicIcon from '@mui/icons-material/QueueMusic';
import AddCircleOutlinedIcon from '@mui/icons-material/AddCircleOutlined';

export default function SideBar(){
    return(
        <>
           <div className="s">
               <div className="s-items">
                   <div className="s-home">
                      <HouseIcon sx={{color:"white"}} fontSize="large"/> 
                      <p classname="diff">Home</p>
                   </div>
                   <div className="s-search">
                       <SearchIcon /> <p classname="diff">Search</p>
                    </div>
                   <div className="s-fav">
                         <StarOutlineIcon /> <p classname="diff">Favourites</p> 
                   </div>
                   <div className="s-playlist">
                         <QueueMusicIcon /> <p classname="diff">PlayList</p>
                   </div>
                   <div className="s-addplist">
                        <AddCircleOutlinedIcon /> <p classname="diff">Craete Playlist</p>
                   </div>
               </div>
           </div>
        </>
    );
}
